css:
@-moz-document url-prefix('https://www.tumblr.com/')

{

.logo .svg-logo
{
display: none !important;
}

H1.logo
{
width: 300px !important;
height: 75px !important;
margin-top: -3px !important;
padding: 4px 0px 0px 4px !important;
}

H1.logo .logo-anchor
{
height: 100% !important;
}

H1.logo > .logo-anchor
{
display: block !important;
background-size: auto !important;
background-image: url(http://media.tumblr.com/57656612e605d30beddbfaa1e8e20ec3/tumblr_inline_mqm3dq4ofb1qz4rgp.png) !important;
background-position: 0px 0px, right !important;
background-repeat: no-repeat !important;
}

}
